    function decToSex(val, ns_ew) {
        let absVal = Math.abs(val);
        let intValue = Math.floor(absVal);
        let dec = absVal - intValue;
        let i = intValue;
        dec *= 60;
        let s = i + "°" + dec.toFixed(2) + "'";

        if (val < 0) {
            s += (ns_ew === 'NS' ? 'S' : 'W');
        } else {
            s += (ns_ew === 'NS' ? 'N' : 'E');
        }

    }

    let i = 0;
    let circle = null;
    let marker = null;

    // on button click
    function drive() {

        // Recurse it that one.
        function moveTo(j) {
            if (j < latlngs.length) {
                let pos = latlngs[i];
                window.setTimeout(() => {
                    console.log(`${i}/${latlngs.length}: ${decToSex(pos[0], "NS")}, ${decToSex(pos[1], "EW")}`);

                    map.panTo(new L.LatLng(pos[0], pos[1]));

                    if (circle !== null) {
                        map.removeLayer(circle);
                    }
                    if (marker !== null) {
                        map.removeLayer(marker);
                    }
                    circle = L.circle([pos[0], pos[1]], 50, {
                        color: 'green',
                        fillColor: '#30f',
                        fillOpacity: 0.25
                    });
                    marker = L.marker([pos[0], pos[1]]);
                    circle.addTo(map);
                    marker.addTo(map)

                    i += 1; // 5;
                    moveTo(i);
                }, 50);
            }
        }
        moveTo(i);
    }

    window.onload = () => {
        document.getElementById('point-card').innerText = `${latlngs.length} points.`;
    };
